script: |
  super -f text -I q5345.spq | sort > q5345.out

inputs:
  - name: q5345.spq
    data: |
      SELECT ALL col1 FROM tab1 (FORMAT parquet) WHERE col0 * col0 * - col0 - - col2 / col0 NOT IN ( col2 / col2 + col1 );
  - name: tab1

outputs:
  - name: q5345.out
    data: |
      10
      13
      26
